import React, { Component } from 'react'

class textAlign extends Component {
    render() {
        return (
            <div>
                <div class="text-align mt-3 ml-2">
                    <div  class="avatar1" style={{color:'#fff',backgroundColor:'#000'}} onclick={this.handlealign} >Left</div>
                    <div  class="avatar1" style={{color:'#000',backgroundColor:'#ddd'}} onclick={this.handlealign}>Center</div>
                    <div  class="avatar1" style={{color:'#000',backgroundColor:'#ddd'}} onclick={this.handlealign}>Right</div>

                </div>
            </div>
        )
    }
}
export default textAlign
